import React from "react"
import { StyleSheet, View, Text, Image } from 'react-native'
import "./assets/css/main.css"
import Axios from 'axios'


export default function LoginPage({ navigation }) {
	const session = localStorage.getItem('session')
	const noteslist = localStorage.getItem('noteslist')
	localStorage.getItem('session', JSON.stringify(session))
	localStorage.getItem('noteslist', JSON.stringify(noteslist))

	const reg = {
		session: session,
		noteslist: noteslist,
	}

	const handleSubmit = () => {
		Axios.post("http://localhost:19007/notestable", reg)
		console.log(reg)
		navigation.navigate('LoginPage')
	}

  return (
	<View>
		<Image source={require('./images/success.png')} style={{
					width: '68%', marginLeft: '16%', height: '68%'
				}} />
		</View>

  )
}

